INSERT INTO `recipe` VALUES (1,'acarrolld','Broccoli with Lemon Butter Sauce',4,45,20,'In a large skillet, combine the butter, water, lemon juice, cayenne pepper, salt and pepper. Bring to a simmer over medium heat. Add the broccoli to the pan, stir to coat, and cover with a lid. Cook for 10 to 15 minutes over medium-low heat, stirring once, until broccoli is tender but still bright green. tuna,  Serve warm, or refrigerate and serve cold.'),(2,'aholmesj','Brocolli mix',6,30,15,'In a large skillet, combine the butter, water, lemon juice, cayenne pepper, salt and pepper. Bring to a simmer over medium heat. Add the broccoli to the pan, stir to coat, and cover with a lid. Cook for 10 to 15 minutes over medium-low heat, stirring once, until broccoli is tender but still bright green. Serve warm, tuna,  or refrigerate and serve cold.'),(3,'earmstrong3','Copycat PaneraÃ‚Â® Broccoli Cheddar Soup',4,20,15,'Melt 1 tablespoon butter in a skillet over medium-high heat. Saute onion in hot butter until translucent, tuna,  about 5 minutes. Set aside.'),(4,'acarrolld','GrandmaÃ¢Â€Â™s Fettuccini Alfredo',3,15,110,'In a large pot over medium heat, simmer the broccoli in the broth for 15 minutes. In a separate skillet over medium heat, melt the butter or margarine, add the onions and saute for 5 minutes, or to desired tenderness.'),(5,'egomezp','Cake of the Day',6,20,100,'Preheat oven to 350 degrees F (175 degrees C). Grease and flour a 12x18 inch pan. Sift together the flour, baking powder, baking soda, salt and cinnamon. Set aside.'),(6,'hspencer1','Apple Butter Spice Cake',4,15,100,'Preheat oven to 350 degrees F (175 degrees C). Grease a 9x13-inch pan.'),(7,'hspencer1','Chap Chee Noodles ',4,10,15,'In a large bowl, combine 1 tablespoon soy sauce, sesame oil, green onions, garlic, sesame seeds, 1 teaspoon sugar, and 1/4 teaspoon pepper. Stir in sliced beef, tuna, and marinate at room temperature for 15 minutes.'),(8,'Palash','roti',2,1,1,'Add wheat flour'),(9,'Palash','rotu',2,0,0,'d