CREATE DEFINER=`root`@`localhost` PROCEDURE `update_profile`(
IN userid Varchar(20) ,
IN uaddress Varchar(20) ,
IN ucity Varchar(25),
IN ustate Varchar(25),
IN zip int,
IN uphoto blob,
IN description Longtext,
in dateOfBirth date,
in mobileNumber varchar(20))
BEGIN
START TRANSACTION;
SET uaddress = IFNULL(uaddress, '');
SET ucity = IFNULL(ucity, '');
SET ustate = IFNULL(ustate, '');
