SET description = IFNULL(description, '');
 IF uphoto='' THEN
update user set uaddress=uaddress, ucity=ucity,ustate=ustate,zip=zip,description=description,dateOfBirth=dateOfBirth,mobileNumber=mobileNumber
where uid=userid;
else
update user set uaddress=uaddress, ucity=ucity,ustate=ustate,zip=zip,uphoto=uphoto,description=description,dateOfBirth=dateOfBirth,mobileNumber=mobileNumber
where uid=userid;
end if;
COMMIT;
END ;;
